import {
    LOAD_DATA,
  } from "../actions/constants";

  const initialState = {
    todolists: [
      {
        createdAt: null,
        _id: null,
        title: null,
        todos: [],
        __v: null,
      },
    ],
    currentTodoList: null,
  };

  const trsReducer = (state = initialState, action) => {
    const { type, payload } = action;
    switch (type) {
      case LOAD_DATA:
        return { ...state, todo: payload };
      default:
        return state;
    }
  };

  export default trsReducer;
